import transactionBusiness from "../business/transactionBusiness";

class Index extends React.Component {
  constructor(props) {
    super(props);

  }

  render() {
    return (
      <DesktopLayout>
        <User />
      </DesktopLayout>
    );
  }
}

class User extends React.Component {
  constructor(props) {
    super(props);
    this.state = { user: {} };
  }

  componentDidMount() {
    subscribe("onSearch", (serial) => {
      var user = transactionBusiness.fetchUserBySerial(serial);
      console.log(user);
      this.setState({ user });
    })

    this.idsubscribe = subscribe("onSearch", (serial) => {
      console.log("hola!!!")
    })
  }

  componentWillUnmount(){
    remove("onSearch",this.idsubscribe);
  }

  render() {



    return (
      <React.Fragment>
        <div>nombre: {this.state.user.nombre} </div>
        <div>Merchant Code: <input></input></div>
        <div><button>Actualizar</button></div>
      </React.Fragment>
    );
  }
}



export default Index;
